import React from 'react';
import SerieCard from './Components/SerieCard/SerieCard';

const SerieList = ({Data}) => {

  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        flexWrap: 'wrap',
      }}
    >
      {Data.map((el,i)=>(<SerieCard key={i} serie={el}/>))}
    </div>
  );
};

export default SerieList;
